import Link from "next/link";

import Layout from "../components/MyLayout.js";

const Index = () => (
  <Layout>
    <section>
      <h1>Welcome to First Check-in!</h1>
      <Link href="/firstParent">
        <button>Start a New Session</button>
      </Link>
    </section>
  </Layout>
);

export default Index;
